const calcY = (x1, y1, x2, y2, x) => (y2 - y1) / (x2 - x1) * (x - x1) + y1;
if (
  x1 === x3 && y1 === y3 ||
  x1 === x4 && y1 === y4 ||
  x2 === x3 && y2 === y3 ||
  x2 === x4 && y2 === y4
) return 1;
if (x1 === x2 && x3 === x4) {
  if (x1 !== x3) return 0;
  if (
    (Math.min(y3, y4) <= y1 && y1 <= Math.max(y3, y4)) ||
    (Math.min(y3, y4) <= y2 && y2 <= Math.max(y3, y4)) ||
    (Math.min(y1, y2) <= y3 && y3 <= Math.max(y1, y2)) ||
    (Math.min(y1, y2) <= y4 && y4 <= Math.max(y1, y2))
  ) return 1;
  return 0;
}
if (y1 === y2 && y3 === y4) {
  if (y1 !== y3) return 0;
  if (
    (Math.min(x3, x4) <= x1 && x1 <= Math.max(x3, x4)) ||
    (Math.min(x3, x4) <= x2 && x2 <= Math.max(x3, x4)) ||
    (Math.min(x1, x2) <= x3 && x3 <= Math.max(x1, x2)) ||
    (Math.min(x1, x2) <= x4 && x4 <= Math.max(x1, x2))
  ) return 1;
  return 0;
}
if (x1 === x2) {
  const s1 = calcY(x3, y3, x4, y4, x1);
  const s2 = calcY(x3, y3, x4, y4, x2);
  if (
    Math.min(x3, x4) <= x1 && x1 <= Math.max(x3, x4) &&
    (
      Math.min(y1, y2) <= s1 && s1 <= Math.max(y1, y2) ||
      Math.min(y1, y2) <= s2 && s2 <= Math.max(y1, y2)
    )
  ) return 1;
  return 0;
}
if (x3 === x4) {
  const s1 = calcY(x1, y1, x2, y2, x3);
  const s2 = calcY(x1, y1, x2, y2, x4);
  if (
    Math.min(x1, x2) <= x3 && x3 <= Math.max(x1, x2) &&
    (
      Math.min(y3, y4) <= s1 && s1 <= Math.max(y3, y4) ||
      Math.min(y3, y4) <= s2 && s2 <= Math.max(y3, y4)
    )
  ) return 1;
  return 0;
}
if (y1 === y2) {
  const s1 = calcX(x3, y3, x4, y4, y1);
  const s2 = calcX(x3, y3, x4, y4, y2);
  if (
    Math.min(y3, y4) <= y1 && y1 <= Math.max(y3, y4) &&
    (
      Math.min(x1, x2) <= s1 && s1 <= Math.max(x1, x2) ||
      Math.min(x1, x2) <= s2 && s2 <= Math.max(x1, x2)
    )
  ) return 1;
  return 0;
}
if (y3 === y4) {
  const s1 = calcX(x1, y1, x2, y2, y3);
  const s2 = calcX(x1, y1, x2, y2, y4);
  if (
    Math.min(y1, y2) <= y3 && y3 <= Math.max(y1, y2) &&
    (
      Math.min(x3, x4) <= s1 && s1 <= Math.max(x3, x4) ||
      Math.min(x3, x4) <= s2 && s2 <= Math.max(x3, x4)
    )
  ) return 1;
  return 0;
}
if (
  (y2 - y1) * (x4 - x3) === (y4 - y3) * (x2 - x1) &&
  (y3 - y1) * (x4 - x2) === (y4 - y2) * (x3 - x1) &&
  (y4 - y1) * (x3 - x2) === (y3 - y2) * (x4 - x1)
) {
  if (
    Math.min(x1, x2) <= Math.min(x3, x4) && Math.min(x3, x4) <= Math.max(x1, x2) ||
    Math.min(x3, x4) <= Math.min(x1, x2) && Math.min(x1, x2) <= Math.max(x3, x4)
  ) return 1;
  return 0;
}
if ((y2 - y1) * (x4 - x3) === (y4 - y3) * (x2 - x1)) return 0;

let xMul = Number(BigInt(y1) * BigInt(x2) * (BigInt(x3) - BigInt(x4)) + BigInt(x1) * BigInt(y2) * (BigInt(x4) - BigInt(x3)) + (BigInt(x2) - BigInt(x1)) * (BigInt(x4) * BigInt(y3) - BigInt(x3) * BigInt(y4)));
let xDiv = (y1 * (x3 - x4) + y2 * (x4 - x3) + (x2 - x1) * (y3 - y4));
if (xDiv < 0) {
  xMul *= -1;
  xDiv *= -1;
}
if (
  Math.max(Math.min(x1, x2), Math.min(x3, x4)) * xDiv <= xMul && xMul <= Math.min(Math.max(x1, x2), Math.max(x3, x4)) * xDiv
) return 1;
